import logo from './Logo.png';
import './App.css';
import ToggleButton from './components/ToggleButton';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Kill yourself!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <div>
        <ToggleButton />;
      </div>
      <div>
        please
      </div>
    </div>
  );
}

export default App;
